import styles from "./Nav.module.css"
import {Link} from "react-router-dom"


function Nav (){
    const navItems = ["Home", "Characters", "Episodes", "Songs"];


    return (
        <ul className={styles.navList}>
            {
                navItems.map((item, index)=>{
                    let linkTo = `/${item}`.toLowerCase();
                    return <Link to={linkTo} key={index}>{item}</Link>
                     //return <li key={key} className={styles.navItem}><Link to={getLink("Characters")}>{item}</Link></li>
                    //return <li key={key} className={styles.navItem}>{item}</li>
                })
            }
        </ul>
    )
}

export default Nav;
